import logo from './logo.svg';
import './App.css';
import Home from './pages/Home';
import { Container, Grid, Typography } from "@material-ui/core";


function App() {

  const style = {
    background: {
      backgroundColor: "black"
    },
    font: {
      color: "white"
    }
  }

  return (
    <div className="App">
      <div style={style.background}>
        <Typography variant="h2" centered style={style.font}>Andrew Rueter Poetry</Typography>
      </div>

      <Home />
    </div>
  );
}

export default App;
